    ContactUsComponent,
    CustomerRelationshipManagerComponent,
    OperationalExecutiveComponent,
    CreditManagerComponent,
    AccountHeadComponent,
    HomeComponent,
    HomeHeaderComponent,
    DashHeaderComponent,
    DashboardComponent,
    EMICalculatorComponent,
    UserMenuComponent,
    ApplyloanComponent,
    ReqcibilComponent,
    ViewEnquiryComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule,
    HttpClientModule,
impNgModule } from '@angular/core';

  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
